import React from 'react';
import { Link } from 'react-router-dom';
import './styles/NotFound.css';
import cyborg from '../images/output-onlinepngtools.png';
import punk from '../images/output-onlinepngtools.png';


class NotFound extends React.Component {
    render() {
      return (
        <div className="Bknd">

        <div className="container">
          <div className="row">
            <div className="Bknd__col col-12 col-md-4">
            <img
                src={punk}
                alt="Conf Logo"
                className="img-fluid mb-2"
              />
            <h1>404: Not Found</h1>

           </div>

            <div className="Bknd__col d-none d-md-block col-md-8">
              <img
                src={cyborg}
                alt="Astronauts"
                className="img-fluid p-4"
              />
            </div>
          </div>
        </div>


          </div>


      );
    }
  }

export default NotFound;
